('Tentacle Smash', 'Increases the damage dealt by Tentacles. When activated, Illaoi smashes down a Tentacle that deals physical damage.', 'Active', '200', '10', 'Unknown', 10),
('Terrify', 'Strikes a target unit with fear, causing it to flee in terror for a duration.', 'Active', '0', '1.25', 'Unknown', 15),
('Terror Capacitor', 'Urgot charges up his capacitor to gain a shield. While the shield is active, Urgot gains slowing attacks.', 'Active', '20', '60', 'Unknown', 16),
('The Box', 'A prison of walls that slow and deal damage if broken.', 'Active', '2', '250', 'Unknown', 140),
('The Culling', 'Lucian unleashes a torrent of shots from his weapons.', 'Active', '20', '3', 'Unknown', 110),
('The Equalizer', 'Rumble fires off a group of rockets, creating a wall of flames that damages and slows enemies.', 'Active', '150', '130', 'Unknown', 110),
('Thick Skin', 'Tahm Kench turns incoming damage into gray health. As gray health decays, Tahm Kench is healed for a percentage of the gray health amount. When activated, this ability turns all gray health into a shield.', 'Active', '25', '3', 'Unknown', 6),
('Threaded Volley', 'Taliyah throws a volley of missiles in a target direction, moving freely as she does. This works the ground below her. If Taliyah casts Threaded Volley on worked ground, she only throws one missile.', 'Active', '50', '60', 'Unknown', 9),
('Thundering Blow / Acceleration Gate', 'Hammer Stance: Deals magic damage to an enemy and knocks them back a short distance.<br><br>Cannon Stance: Deploys an Acceleration Gate increasing the Movement Speed of all allied champions who pass through it. If Shock Blast is fired through the gate the', 'Active', '0.25', '200', 'Unknown', 15),
('Thundering Shuriken', 'Kennen throws a fast moving shuriken towards a location, causing damage and adding a Mark of the Storm to any opponent that it hits.', 'Active', '0', '75', 'Unknown', 8),
('Tidal Wave', 'Summons a massive Tidal Wave that knocks up, slows, and damages enemies. Allies hit gain double the effect of Surging Tides.', 'Active', '150', '150', 'Unknown', 120),
('Time Bomb', 'Tosses a bomb to target area that sticks to units that come near it (prioritizes Champions). It detonates after 3 seconds, dealing area of effect damage. If a Time Bomb is detonated early by another Time Bomb, it also stuns enemies.', 'Active', '3', '75', 'Unknown', 10),
('Timewinder', 'Ekko throws a temporal grenade that expands into a time-distortion field upon hitting an enemy champion, slowing and damaging anyone caught inside. After a delay, the grenade rewinds back to Ekko, dealing damage on its return.', 'Active', '32', '60', 'Unknown', 9),
('To the Skies! / Shock Blast', 'Hammer Stance: Leaps to an enemy dealing physical damage and slowing enemies.<br><br>Cannon Stance: Fires an orb of electricity that detonates upon hitting an enemy (or reaching the end of its path) dealing physical damage to all enemies hit.', 'Active', '1.5', '40', 'Unknown', 16),
('Tongue Lash', 'Tahm Kench lashes out with his tongue, damaging and slowing the first unit hit. This ability gains a stun after three stacks of An Acquired Taste.', 'Active', '1000', '875', 'Unknown', 6),
('Torment', 'Swain afflicts his target, dealing damage to them over time and causing them to take increased damage from Swain. Enemies afflicted by Torment are focused by Beatrice while Decrepify is active.', 'Active', '20', '50', 'Unknown', 10),
('Tormented Soil', 'Infects an area with desecrated soil, causing enemy units who stand on the location to take continual damage.', 'Active', '0.5', '8', 'Unknown', 10),
('Transcendent Blades', 'Irelia summons 4 spirit blades that she can fling to deal physical damage and siphon life from enemies they pass through.', 'Active', '10', '80', 'Unknown', 110),
('Tremors', 'Rammus creates waves of destruction pulsing through the ground, causing damage to units and structures near him.', 'Active', '8', '65', 'Unknown', 100),
('Triggerseed', 'Ivern places a shield on an ally which explodes after a short duration slowing and damaging enemies.', 'Active', '60', '80', 'Unknown', 12),
('Trueshot Barrage', 'Ezreal winds up for 1 second to fire a powerful barrage of energy missiles which do massive damage to each unit they pass through (deals 10% less damage to each unit it passes through).', 'Active', '10', '350', 'Unknown', 120),
('Tumble', 'Vayne tumbles, maneuvering to carefully place her next shot. Her next attack deals bonus damage.', 'Active', '30', '7', 'Unknown', 6),
('Turtle Stance', 'Turtle Stance: Activation - Udyr gains a temporary shield that absorbs damage. Persistent Effect - Udyr gains Life Steal.', 'Active', '10', '60', 'Unknown', 6),
('Twilight Shroud', 'Akali teleports to a nearby location, leaving a cover of smoke at her previous location. While inside the shroud, Akali becomes Invisible and gains Movement Speed. Attacking or using abilities will briefly reveal her. Enemies inside the smoke have their M', 'Active', '8', '425', 'Unknown', 20),
('Twin Bite', 'Shyvana strikes twice on her next attack. Basic attacks reduce the cooldown of Twin Bite by 0.5 seconds.<br><br><span class="colorFF3300">Dragon Form: </span>Twin Bite cleaves all units in front Shyvana.', 'Active', '250', '40', 'Unknown', 9),
('Twisted Advance', 'Maokai dissolves into a cloud of arcane energies. He regrows near a target enemy, dealing damage and rooting it in place.', 'Active', '1', '9', 'Unknown', 13),
('Unbreakable Will', 'Alistar lets out a wild roar, removing all crowd control effects on himself, and reducing incoming physical and magical damage for the duration.', 'Active', '50', '7', 'Unknown', 120),
('Unleashed Power', 'Syndra bombards an enemy Champion with all of her Dark Spheres.', 'Active', '270', '90', 'Unknown', 100),
('Unraveled Earth', 'Taliyah creates a slowing minefield that explodes if enemies dash through it or are pushed/pulled through it.', 'Active', '-0.2', '70', 'Unknown', 16),
('Unstoppable Force', 'Malphite ferociously charges to a location, damaging enemies and knocking them into the air.', 'Active', '200', '1.5', 'Unknown', 130),
('Unstoppable Onslaught', 'Sion charges in a direction, ramping up speed over time. He can steer his charge slightly with the mouse cursor location. When he collides with an enemy he deals damage and knocks them up based on the distance he has charged.', 'Active', '300', '150', 'Unknown', 140),
('UPGRADE!!!', 'Heimerdinger invents an upgrade, causing his next spell to have increased effects.', 'Active', '80', '200', 'Unknown', 100),
('Valkyrie', 'Corki flies a short distance, dropping bombs that create a trail of fire that damages opponents who remain in it.', 'Active', '90', '60', 'Unknown', 20),
('Valor', 'Riven steps forward a short distance and blocks incoming damage.', 'Active', '90', '90', 'Unknown', 10),
('Vault Breaker', 'Vi charges her gauntlets and unleashes a vault shattering punch, carrying her forward. Enemies she hits are knocked back and receive a stack of Denting Blows.', 'Active', '2', '100', 'Unknown', 16),
('Vengeful Maelstrom', 'Maokai shields his allies by drawing power from hostile spells and attacks, reducing non-tower damage done to allied champions in the area. When Maokai ends the effect, he unleashes the absorbed energy to deal damage to enemies within the vortex.', 'Active', '10', '20', 'Unknown', 60),
('Venom Cask', 'Twitch hurls a cask of venom that explodes in an area, slowing targets and applying deadly venom to the target.', 'Active', '25', '2', 'Unknown', 13),
('Violent Tendencies', 'Kled gains massive attack speed for four attacks. The fourth attack deals more damage.', 'Active', '150', '4', 'Unknown', 14),
('Voice of Light', 'Aurelion Sol projects a blast of pure starfire, damaging and slowing all enemies caught in it and knocking nearby enemies back to a safer distance.', 'Active', '40', '150', 'Unknown', 120),
('Void Swarm', 'Malzahar summons a Voidling. The first time a summoned Voidling attacks a champion or monster, Malzahar summons a new Voidling.', 'Active', '100', '12', 'Unknown', 0),
('Volatile Spiderling / Skittering Frenzy', 'Human Form: Releases a venom-gorged Spiderling that explodes when it nears a target.<br><br>Spider Form: Elise and her Spiderlings gain Attack Speed.', 'Active', '60', '4', 'Unknown', 12),
('Volley', 'Ashe fires 9 arrows in a cone for increased damage. Also applies Frost Shot.', 'Active', '20', '5', 'Unknown', 15),
('Wall of Pain', 'Karthus creates a passable screen of leeching energy. Any enemy units that walk through the screen have their Movement Speed and Magic Resist reduced for a period.', 'Active', '800', '15', 'Unknown', 18),
('Whirling Death', 'Draven hurls two massive axes to deal physical damage to each unit struck. Whirling Death slowly reverses direction and returns to Draven after striking an enemy champion. Draven may also activate this ability while the axes are in flight to cause it to r', 'Active', '40', '175', 'Unknown', 100),
('Wild Cards', 'Twisted Fate throws three cards, dealing damage to each enemy unit they pass through.', 'Active', '40', '60', 'Unknown', 6),
('Wild Growth', 'Lulu enlarges an ally, knocking nearby enemies into the air and granting the ally a large amount of bonus health. For the next few seconds, that ally gains an aura that slows nearby enemies.', 'Active', '30', '300', 'Unknown', 110),
('Wind Wall', 'Creates a moving wall that blocks enemy projectiles.', 'Active', '60', '15', 'Unknown', 26),
('Wish', 'Soraka fills her allies with hope, instantly restoring health to herself and all friendly champions.', 'Active', '120', '150', 'Unknown', 160),
('Wither', 'Nasus ages an enemy champion, decelerating their Movement and Attack Speeds over time.', 'Active', '35', '47', 'Unknown', 15),
('Wuju Style', 'Master Yi becomes skilled in the art of Wuju, passively increasing his Attack Damage. Activating Wuju Style grants bonus true damage on basic attacks, but the passive bonus is then lost while on cooldown.', 'Active', '25', '10', 'Unknown', 18),
('Yordle Snap Trap', 'Caitlyn sets a trap to find sneaky yordles. When sprung, the trap reveals and immobilizes the enemy champion for 1.5 seconds.', 'Active', '30', '2', 'Unknown', 1),
('Zap!', 'Jinx uses Zapper, her shock pistol, to fire a blast that deals damage to the first enemy hit, slowing and revealing it.', 'Active', '30', '10', 'Unknown', 10),
('Zenith Blade', 'Leona projects a solar image of her sword, dealing magic damage to all enemies in a line. When the image fades, the last enemy champion struck will be briefly immobilized and Leona will dash to them.', 'Active', '0.5', '60', 'Unknown', 13);
